import React, { useState } from "react";
import "./login.css";
export const Login = (props) => {
  const [name, setName] = useState(""); // to set the data of the user
  const [pass, setPass] = useState("");
  const [number, setNumber] = useState("");

  // after updating for storing the value after submission we use usehandling

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(name);
    console.log(number);
  };
  return (
    <div className="auth-form-container">
      <form className="login-form" onSubmit={handleSubmit}>
        <label for="name">Name</label>
        <input
          value={name}
          type="text"
          placeholder="Full Name"
          id="name"
          name="name"
        />
        <label for="number">Roll No.</label>
        <input value={number} type="phone" placeholder="Roll No." id="number" />
        <label for="password">Password</label>
        <input
          value={pass}
          type="password"
          placeholder="password"
          id="password"
          name="password"
        />
        <button type="submit">Log In</button>
      </form>
      <button onClick={() => props.onFromSwitch("registor")}>
        Don't have an account? Registor
      </button>
    </div>
  );
};
